import React from 'react';

import Header from './components/Interview/Header';
import AddMeeting from './components/Interview/AddInterview';
import ViewInterview from './components/Interview/ViewInterview';
import EditInterview from './components/Interview/EditInterview';

function App() {
  return (
    <div>
      <Header></Header>
      <AddMeeting></AddMeeting>
      <ViewInterview></ViewInterview>
      <EditInterview></EditInterview>
    </div>
  );
}

export default App;
